import React from "react";
import Jayatable from "../Jayatable/Jayatable";

const JayaRank = () => {
  return (
    <div className="">
      <div className="px-32 w-full ">
        <div className="flex mt-6 py-4 rounded-xl text-white space-y-6 flex-col  justify-center bg-green-600 items-center ">
          <div className="flex flex-col space-y-4">
            <h3 className="text-xl font-sans font-bold">
              Login / register now become JAYA9 VIP
            </h3>
            <p className="text-center font-sans font-bold">
              Get the Benefits Now
            </p>
          </div>
          <div className="flex flex-row gap-32  justify-between">
            <button className="border border-white  px-4 py-2 hover:border-orange-500 outline-none rounded-sm text-white">
              প্রবেশ করুন
            </button>

            <button className="bg-common-orange px-8  py-2 rounded-sm">
              নিবন্ধন
            </button>
          </div>
        </div>
      </div>
      <Jayatable></Jayatable>
    </div>
  );
};

export default JayaRank;
